UmiverseVerify.sol.content:
    // SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./lib/Strings.sol";
import "./lib/Signature.sol";

contract UmiverseVerify {
    using Signature for uint256;

    function getMessageHash(
        uint256 _timestamp
    ) public pure returns (bytes32) {
        return
            keccak256(
                abi.encodePacked(
                    _timestamp
                )
            );
    }

    function verify(
        address _signer,
        uint256 _timestamp,
        bytes memory _signature
    )public pure returns (bool) {
        bytes32 messageHash = getMessageHash(
            _timestamp
        );
        bytes32 ethSignedMessageHash = Signature.getEthSignedMessageHash(messageHash);
        return Signature.recoverSigner(ethSignedMessageHash, _signature) == _signer;
    }


}

lib/Signature.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

library Signature {
    function getEthSignedMessageHash(bytes32 _messageHash)
        internal
        pure
        returns (bytes32)
    {
        return
            keccak256(
                abi.encodePacked(
                    "\x19Ethereum Signed Message:\n32",
                    _messageHash
                )
            );
    }

    function recoverSigner(
        bytes32 _ethSignedMessageHash,
        bytes memory _signature
    ) internal pure returns (address) {
        (bytes32 r, bytes32 s, uint8 v) = splitSignature(_signature);
        return ecrecover(_ethSignedMessageHash, v, r, s);
    }

    function recoverSignerPublic(
        bytes32 _ethSignedMessageHash,
        bytes memory _signature
    ) public pure returns (address) {
        (bytes32 r, bytes32 s, uint8 v) = splitSignature(_signature);
        return ecrecover(_ethSignedMessageHash, v, r, s);
    }

    function splitSignature(bytes memory sig)
        internal
        pure
        returns (
            bytes32 r,
            bytes32 s,
            uint8 v
        )
    {
        require(sig.length == 65, "invalid signature length");
        assembly {
            r := mload(add(sig, 32))
            s := mload(add(sig, 64))
            v := byte(0, mload(add(sig, 96)))
        }
    }
}

